import ProfileTask from './ProfileTask.js'



class ProfileTaskContainer extends React.Component {

    render() {

        let tasksArray = this.props.tasks

        let routerHistory = this.props.history

        let renderTasks = tasksArray.map(task => {
            if (task.task_doer.id === currentUser.id) {
            return <ProfileTask
                key={task.id}
                task={task}
                routerHistory = {routerHistory}
                currentUser ={this.props.currentUser}
            />
            }
        })



        return(
            <>
                <p>Test</p>
                <ul className= "lendtask">
                    {renderTasks}
                </ul>

            </>
        )
    }


}

export default ProfileTaskContainer;
